const request = require('request-promise-native');

const MEASUREMENT = 'leadtime_pf_web';
const API_TOKEN = '';
const DOMAIN = 'https://app.leanix.net';
const WORKSPACE_ID = ''

async function getAccessToken(apiToken) {
  try {
    const result = await request.post({
      url: `${DOMAIN}/services/mtm/v1/oauth2/token`,
      auth: {
        user: 'apitoken',
        password: apiToken
      },
      headers: {
        'Content-Type': 'application/x-www-form-urlencoded'
      },
      body: 'grant_type=client_credentials',
      json: true
    });
    return result.access_token;
  } catch (error) {
    console.log('Error while fetching access token:', error);
    process.exit(1);
  }
}

function generateMetricsPoint(metricsType, value, timeStamp) {
  return {
    measurement: MEASUREMENT,
    workspaceId: WORKSPACE_ID,
    time: new Date(timeStamp).toISOString(),
    tags: [{
      k: 'externalIdProject',
      v: 'leanix-pathfinder-web'
    }
    ],
    fields: [
      {
        k: `${metricsType}`,
        v: value
      }
    ]
  };
}

async function sendMetrics(accessToken, metricsPoint) {
  try {
    return request.post({
      url: `${DOMAIN}/services/metrics/v1/points`,
      headers: {
        'Authorization': `Bearer ${accessToken}`,
      },
      body: metricsPoint,
      json: true
    });
  } catch (error) {
    console.log('Error sending metrics:', error, 'for point ', metricsPoint);
    process.exit(1);
  }
}


async function main() {
  try {
    const accessToken = await getAccessToken(API_TOKEN);
    for (result of results) {
      if (result.deployDate && result.averageLeadTimeInMs !== 0) {

        const metricsPoint = generateMetricsPoint('averageLeadTime', result.averageLeadTimeInMs / 1000 / 60 / 60, result.deployDate);
        await sendMetrics(accessToken, metricsPoint);
        console.log(JSON.stringify(metricsPoint));
      }
    }
  } catch (error) {
    console.log(error);
  }
  console.log('Done!');

}

main();
